import React from "react";
import {
  CardContainer,
  CardTop,
  CardDot,
  CardBar,
  CardBg,
  CardBtn,
} from "./CardElms";
import Screen1 from "../../images/screen1.png";

const Card = () => {
  return (
    <CardContainer>
      <CardTop>
        <CardDot />
        <CardDot />
        <CardDot />
        <CardBar />
      </CardTop>
      <CardBg src={Screen1} type="image/png" />
    </CardContainer>
  );
};

export default Card;
